import "./index.css";

const Header = () => {
  return (
    <div className="header">
      <div className="navbar">
        <img
          src="https://static.vecteezy.com/system/resources/previews/002/534/045/original/social-media-twitter-logo-blue-isolated-free-vector.jpg"
          alt="logo"
        />
        <ul>
          <li>
            <a href="">Home</a>
          </li>
          <li>
            <a href="">About</a>
          </li>
          <li>
            <a href="">Contacts</a>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Header;
